  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:29.162966\",\n\t\"name\": \"whooping-cranes-during-the-1985-1986-winter\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report attempts to summarize whooping
  crane data collected by the Aransas biologist during the 1985-86 winter. It focuses
  on the distribution of the Wood Buffalo/Aransas flock on the wintering grounds.
  Emphasis is placed on color banded individuals and is in part a continuation of
  the work initiated by Mary Bishop in 1978. Portions of this report were borrowed
  from the Aransas 1985 Annual Narrative Report. Excerpts will be used to write the
  refuges 1986 Annual Narrative Report. The annual narrative reports are difficult
  to write since they are based on the calendar year which splits the winter whooping
  crane data in half. Also, much of the data included here are much too detailed to
  be included in the Annual Narrative Report.\",\n\t\"license_title\": \"License Not
